import React from 'react'
import './listsearch.css'

function ListSearch() {
  return (
    <div className="listsearch">
        <h1 className="listTitle">Search</h1>
        <div className="searchItem">
            <label htmlFor="">Destination</label>
        </div>
    </div>
  )
}

export default ListSearch
